import React from "react";
import "../styles/cafes";
import LocationCard from "../shared/LocationCard";
import CommonSection from "../shared/hotel/CommonSection-hotel";
import SearchBar from "../shared/SearchBar";
import { Col, Container, Row } from "reactstrap";
import hotelData from "../assets/data/hotels";
const Cafes = () => {
    return <>
    <CommonSection title={"All Cafes"} />
    <section>
        <Container>
            <Row>
                <SearchBar />
            </Row>
        </Container>
    </section>
    <section>
        <Container>
            <Row>
                {
                    cafeData?.map(location => <Col lg="3" key={location.id}> <LocationCard location={location} /></Col>)

                }
            </Row>
        </Container>
    </section>
    </>

};
export default Cafes;
